import React from "react";
import List from "../../src/moveOutList.json";

const MoveOutList = () => {
  return (
    <div>
      Move-out-listx
      {List.map((MoveList, index) => {
        return <div>{MoveList.address}</div>;
      })}
    </div>
  );
};

export default MoveOutList;
